import React from 'react';
import Header from './Header';
import '../css/EventPage.css';

function EventPage() {
  return (
    <div>
      <Header />
      <div id='container'>
        <h1>이벤트페이지입니다.</h1>
        <h6 id='SearchResult'>검색 결과 </h6>
        <input type='text' />
        <input type='text' />
        <input type='text' />
      </div>
    </div>
  );
}

export default EventPage;
